async function GetJewelPriceandFee(tier,colorname,quality)
{
    var APIData = "";

    if(quality == "all")
    {
        APIData = await GetRAPIData("bazaar/jewels/offers/?color_name=" + colorname.toUpperCase() + "&tier=" + tier + "&max_price=100&min_price=0.00&page=1&sort_by=full_price&sort_dir=asc");

    }
    else
    {
        APIData = await GetRAPIData("bazaar/jewels/offers/?color_name=" + colorname.toUpperCase() + "&tier=" + tier + "&quality_level=" + quality.toUpperCase() + "&max_price=100&min_price=0.00&page=1&sort_by=full_price&sort_dir=asc");
    }

    //Output("<b>T" + tier + " " + colorname + ":</b> Price:  " + APIData.data[0].price + "; Fee: " + APIData.data[0].fee + "; Full price: " + APIData.data[0].full_price + "&nbsp; &nbsp; &nbsp; &nbsp;");
    Output("<table><tr style='padding: 0;'><td style='width: 20%; padding: 0; text-align: center;'>T" + tier + " " + colorname + "</td><td style='width: 20%; padding: 0; text-align: center;'>" + Number(APIData.data[0].price).toFixed(2) + "</td><td style='width: 20%; padding: 0; text-align: center;'>" + Number(APIData.data[0].fee).toFixed(2) + "</td><td style='width: 20%; padding: 0; text-align: center;'>" + Number(APIData.data[0].full_price).toFixed(2) + "</td></tr></table>",false);

}

