async function DownloadSavedPropertiesDataAsCSV()
{


 if(localStorage.getItem('E2MultiTool_PropertiesDataDate') != null)
   {
       var data = JSON.parse(localStorage.getItem('E2MultiTool_Properties'));

       data.forEach((element) => {
           element[1] = element[1].replaceAll('&amp;','&')
                    .replaceAll('&gt;', '>')
                    .replaceAll('&lt;','<')
                    .replaceAll('&#35;','NUMBERSIGN')
                    .replaceAll('&quot;','"')
                    .replaceAll('&#44;',',')
                    .replaceAll('&#768;',' ̀')
                    .replaceAll('&DiacriticalGrave;','`')
                    .replaceAll('&grave;','`')
                    .replaceAll('&dollar;','$')
                    .replaceAll('&#41;',')')
                    .replaceAll('&#40;','(')
                    .replaceAll('&plus;','+')
                    .replaceAll('&sol;','/')
                    .replaceAll('&equals;','=')
                    .replaceAll('&lbrack;','[')
                    .replaceAll('&rbrack;',']')
                    .replaceAll('&lbrace;','{')
                    .replaceAll('&rbrace;','}')
                    .replaceAll('&#39;',"'")
       });

       //console.log(data);

       var csvContent = "data:text/csv;charset=utf-8,";
       csvContent += encodeURIComponent("ID,title,tier,tiles,location,latitude,longitude, holobuilding ID,res_gold,res_oil,res_limestone,res_iron,res_coal, class, for sale, holo space (m3), transformed essence, EPL, purchase price, current value, purchase date, generated x times LIT, LIT amount\r\n");

       csvContent += encodeURIComponent(data.map(rowArray => rowArray.join(",")).join("\r\n"));

       //var encodedUri = encodeURI(csvContent);
       //window.open(encodedUri);


       var DownloadLink = document.createElement("a");
       DownloadLink.href = csvContent;
       DownloadLink.download = "E2Multitool_Properties(" + localStorage.getItem('E2MultiTool_PropertiesDataDate').replace(':','-').replace(' ','_') + ").csv";

       document.body.appendChild(DownloadLink);
       DownloadLink.click();
       document.body.removeChild(DownloadLink);
   }
   else
   {
       ClearOutput();
       Output(`
       <br><br>Error: No properties data saved local! <br>Please load data first: <br>
       <button id="Button_GetData" style="width:30%; border: 1px solid black; background:lightgrey">Load/update properties data</button>
       `);
       $("#Button_GetData").click({param1: "1"},LoadMapProperties);
   }


}




